import 'package:cached_network_image/cached_network_image.dart';
import 'package:flutter/material.dart';

void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      title: 'Images',
      theme: ThemeData(
        colorScheme: ColorScheme.fromSeed(seedColor: Colors.deepPurple),
        useMaterial3: true,
      ),
      home: const MyHomePage(title: 'Images'),
    );
  }
}

class MyHomePage extends StatefulWidget {
  const MyHomePage({super.key, required this.title});

  final String title;

  @override
  State<MyHomePage> createState() => _MyHomePageState();
}

class _MyHomePageState extends State<MyHomePage> {
  List<String> images = [
    'data:image/jpeg;base64,',
    'https://buffer.com/cdn-cgi/image/w=1000,fit=contain,q=90,f=auto/library/content/images/size/w600/2023/07/sergey-shmidt-koy6FlCCy5s-unsplash.jpg',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTwzl0Lq_OtaC4FngIrVUng_WSOOHOcUW_3V9mwmWcgzQ&s',
    'data:image/jpeg;base64,',
    'https://buffer.com/library/content/images/2023/09/instagram-image-size.jpg',
  ];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
        appBar: AppBar(
          backgroundColor: Theme
              .of(context)
              .colorScheme
              .inversePrimary,
          title: Text(widget.title),
        ),
        body: ListView.builder(
            itemCount: images.length,
            itemBuilder: (context, index) {
              return CachedNetworkImage(
                  imageUrl: images[index],
                  progressIndicatorBuilder: (context, url, progress) =>
                      CircularProgressIndicator(),
                  errorWidget: (context, url, error) =>
                  const Center(
                      child: Icon(
                          Icons.error,
                          color: Colors.red)
                  )
              );
            }
        )
    );
  }
}